import React from 'react'

import './Times.css'

export default function Times(props) {
    const { handleTime, active } = props;
    const bookingSlots = ["06:00 - 09:00", "09:00 - 12:00", "12:00 - 15:00", "15:00 - 18:00"];

    return (
        <div className="time-slots-container">
            <button
                className={active ? "active" : ""}
                onClick={() => handleTime("06:00 - 09:00")}>
                06:00 - 09:00
            </button>
            <button
                className={active ? "active" : ""}
                onClick={() => handleTime("09:00 - 12:00")}>
               09:00 - 12:00
            </button>
            <button
                className={active ? "active" : ""}
                onClick={() => handleTime("12:00 - 15:00")}>
                12:00 - 15:00
            </button>
            <button
                className={active ? "active" : ""}
                onClick={() => handleTime("06:00 - 09:00")}>
                06:00 - 09:00
            </button>
        </div>
    )
}
